from DNAtoRNA import DNAtoRNA
import unittest

class TestDNAToRNA(unittest.TestCase):
    
    def test(self):
        self.assertEqual(DNAtoRNA("TTTT"), "UUUU")
        self.assertEqual(DNAtoRNA("GCAT"), "GCAU")
        self.assertEqual(DNAtoRNA("GACCGCCGCC"), "GACCGCCGCC")
        self.assertEqual(DNAtoRNA("GATTCCACCGACTTCCCAAGTACCGGAAGCGCGACCAACTCGCACAGC"), "GAUUCCACCGACUUCCCAAGUACCGGAAGCGCGACCAACUCGCACAGC")
        self.assertEqual(DNAtoRNA("CACGACATACGGAGCAGCGCACGGTTAGTACAGCTGTCGGTGAACTCCATGACA"), 'CACGACAUACGGAGCAGCGCACGGUUAGUACAGCUGUCGGUGAACUCCAUGACA')
        self.assertEqual(DNAtoRNA("CACGACATACGGAGCAGCGCACGGTTAGTACAGCTGTCGGTGAACTCCATGACA"), 'CACGACAUACGGAGCAGCGCACGGUUAGUACAGCUGUCGGUGAACUCCAUGACA')
        self.assertEqual(DNAtoRNA("AACCCTGTCCACCAGTAACGTAGGCCGACGGGAAAAATAAACGATCTGTCAATG"), 'AACCCUGUCCACCAGUAACGUAGGCCGACGGGAAAAAUAAACGAUCUGUCAAUG')
        self.assertEqual(DNAtoRNA(""), '')
        
if __name__ == '__main__':
    unittest.main()